import React from 'react';
import 'antd/dist/antd.css';
import './App.css';
import ContactList from './Components/ContactList';
import Sidebar from './Components/Sidebar';

function App() {
  return (
    <div className="App">
      <Sidebar />
      <ContactList />
    </div>
  );
}

export default App;
